import React, { Component } from 'react'
import { Form } from "react-bootstrap"

export class Registration extends Component {
    render () {
        return (
            <div>
                <Form>
                    <Form.Group controlId="hc-reg-patient-name">
                        <Form.Label>Please complete the registration form below</Form.Label>
                        <br />
                        <Form.Control type="text" placeholder="Patient Full Name (First/Last)" />
                        <Form.Control type="number" placeholder="NPI Number" />
                        <Form.Control type="text" placeholder="Phone Number" />
                        <Form.Control type="email" placeholder="Email Address" />
                    </Form.Group>
                </Form>
            </div>
        )
    }
}

export default Registration;
